export class user{
    userName: string;
    password: string;
    fullName: string;
    email: string;
    userRole: string;

    constructor( userName: string, password: string, fullName: string = '', email: string = '', userRole: string = '' ){
      this.userName = userName;
      this.password = password;
      this.fullName = fullName;
      this.email = email;
      this.userRole = userRole;
    }
}
